import React from "react"

function Feature(){
    return <div className="feature">
       <h2>GET FOOD FAST — NOT FAST FOOD</h2>
       <p>We're Omnifood, a new premium food delivery service. We know you're busy and find no time to cook. But don't worry—relax, and let us take care of that. We happen to be really good at it!</p>

    </div>
}

export default Feature;
